<?php

interface Event
{
    public function id(): UuidInterface;
    public function aggregateId(): string;
    public function occured(): DateTimeImmutable;
}

trait EventId
{
    /** @var UuidInterface */
    private $id;

    /** @var string */
    private $aggregateId;

    /** @var DateTimeImmutable */
    private $occured;

    final private function setupRequiredId(string $aggregateId): void
    {
        $this->id = Uuid::uuid4();
        $this->aggregateId = $aggregateId;
        $this->occured = new DateTimeImmutable();
    }

    final public function id(): UuidInterface
    {
        return $this->id;
    }

    final public function aggregateId(): string
    {
        return $this->aggregateId;
    }

    final public function occured(): DateTimeImmutable
    {
        return $this->occured;
    }
}

/** @psalm-immutable */
final class OrderPayed implements Event
{
    use EventId;

    /** @var int */
    private $price;

    public function __construct(string $aggregateId, int $price)
    {
        $this->setupRequiredId($aggregateId);
        $this->price   = $price;
    }

    public function getPrice(): int
    {
        return $this->price;
    }
}
```

